B.a7a=new A.b4("Privacy Policy \nDRVRMATE is committed to providing quality services to you and this policy outlines our ongoing obligations to you in respect of how we manage your Personal Information.We have adopted the Australian Privacy Principles (APPs) contained in the Privacy Act 1988 (Cth) (the Privacy Act). The NPPs govern the way in which we collect, use, disclose, store, secure and dispose of your Personal Information.A copy of the Australian Privacy Principles may be obtained from the website of The Office of the Australian Information Commissioner at https://www.oaic.gov.au/. \n\nWhat is Personal Information and why do we collect it?\nPersonal Information is information or an opinion that identifies an individual. Examples of Personal Information we collect includes names, addresses, email addresses, phone and facsimile numbers.This Personal Information is obtained in many ways including [interviews, correspondence, by telephone and facsimile, by email, via our website www.yourbusinessname.com.au, from your website, from media and publications, from other publicly available sources, from cookies- delete all that aren\u2019t applicable] and from third parties. We don\u2019t guarantee website links or policy of authorised third parties.We collect your Personal Information for the primary purpose of providing our services to you, providing information to our clients and marketing. We may also use your Personal Information for secondary purposes closely related to the primary purpose, in circumstances where you would reasonably expect such use or disclosure. You may unsubscribe from our mailing/marketing lists at any time by contacting us in writing.When we collect Personal Information we will, where appropriate and where possible, explain to you why we are collecting the information and how we plan to use it.\n\nSensitive Information\nSensitive information is defined in the Privacy Act to include information or opinion about such things as an individual's racial or ethnic origin, political opinions, membership of a political association, religious or philosophical beliefs, membership of a trade union or other professional body, criminal record or health information.Sensitive information will be used by us only:\n\u2022\tFor the primary purpose for which it was obtained\n\u2022\tFor a secondary purpose that is directly related to the primary purpose\n\u2022\tWith your consent; or where required or authorised by law.\n\nThird Parties\nWhere reasonable and practicable to do so, we will collect your Personal Information only from you. However, in some circumstances we may be provided with information by third parties. In such a case we will take reasonable steps to ensure that you are made aware of the information provided to us by the third party.\n\nDisclosure of Personal Information\nYour Personal Information may be disclosed in a number of circumstances including the following:\u2022\tThird parties where you consent to the use or disclosure; and\u2022\tWhere required or authorised by law.\n\nSecurity of Personal Information\nYour Personal Information is stored in a manner that reasonably protects it from misuse and loss and from unauthorised access, modification or disclosure.When your Personal Information is no longer needed for the purpose for which it was obtained, we will take reasonable steps to destroy or permanently de-identify your Personal Information. However, most of the Personal Information is or will be stored in client files which will be kept by us for a minimum of 7 years.\n\nAccess to your Personal Information\nYou may access the Personal Information we hold about you and to update and/or correct it, subject to certain exceptions. If you wish to access your Personal Information, please contact us in writing. DRVRMATE will not charge any fee for your access request, but may charge an administrative fee for providing a copy of your Personal Information.In order to protect your Personal Information we may require identification from you before releasing the requested information.\n\nMaintaining the Quality of your Personal Information\nIt is an important to us that your Personal Information is up to date. We  will  take reasonable steps to make sure that your Personal Information is accurate, complete and up-to-date. If you find that the information we have is not up to date or is inaccurate, please advise us as soon as practicable so we can update our records and ensure we can continue to provide quality services to you.\n\nPolicy Updates\nThis Policy may change from time to time and is available on our website.\n\nPrivacy Policy Complaints and Enquiries\nIf you have any queries or complaints about our Privacy Policy please contact us at:\n admin@drvrmate.com",null,null,null,null,null,null,null,null)
